    {/* see above */}
    <img src={img} />
    <h5>About the Instructor: Advanced Hot Bikram Yoga </h5>
    <h5> Teaching Style: "I teach an athletic and advanced class." </h5>
    <h5>
      {" "}
      Teaching Background: "I got into yoga when a buddy of mine suggested it
